CREATE TABLE "counties" ("county_code" varchar(255),"city_code" varchar(255),"province_code" varchar(255),"country_code" varchar(255),"short_code" varchar(255),"short_name" varchar(255),"full_name" varchar(255),"english_name" varchar(255),"longitude" real DEFAULT 0.0,"latitude" real DEFAULT 0.0,"altitude" real,"area" real,"time_zone" varchar(255) DEFAULT 'UTC+08:00',"postcode" varchar(255),"area_code" varchar(255),"comment" varchar(255),"iso3166" varchar(255),"created_at" datetime,"updated_at" datetime , PRIMARY KEY ("county_code","city_code","province_code","country_code"));

